    console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>UserName</th>
                    </tr>
                </thead>

                {!data ? <h1>Loding...</h1> : <tbody>
                    {data.map((val) => {
                        return <td >{val.title}</td>
                    })}
                    <button onClick={onchenge}>Next Data</button>
                    <button>Prev Data</button>
                </tbody>}



            </table>
            <button>Left</button>
            <button onClick={onchenge}>Right</button>
        </div>
    )
}
